import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';

import ReceiptsList from '../../Components/Receipts/ReceiptsList';
import SingleReceipt from '../../Components/Receipts/SingleReceipt';
import NewExport from '../../Components/Receipts/New';

import { receipts } from '../../Utils/Dummydata';

class Receipts extends Component {
    constructor(props) {
        super(props);

        this.state = {
           receipts: receipts
        };
     }


    render () {
        return (
            <div className="row panel-content">
            <div className="col">
               <Switch>
                  <Route exact path="/panel/transfers" receipts={this.state.receipts} component={ReceiptsList} />
                  <Route path="/panel/transfers/new" component={NewExport} />
                  <Route path="/panel/transfers/:receiptId" component={SingleReceipt} />
               </Switch>
            </div>
         </div>
        )
    }
};

export default Receipts;
